Summer Bulldog Slush
—————————
3 oz Vodka
1 cup fruit punch
1/4 cup lime juice
2 cups frozen strawberries
2 cups ice cubes
Garnish: @SeagramsEscapes Jamaican Me Happy (chilled) & fruit skewer
—————————
1- In blender, combine ingredients with ice then pulse. Pour into two large margarita glasses.
2- Invert each bottle of Jamaican Me Happy into a sturdy glass and rest against the side of glass quickly and carefully. Garnish with fruit skewers. Serve immediately
