Cheers to the weekend folks, and a long weekend at that! 🇨🇦🥂 #labourdayweekend

Here’s a little Friday #cocktailhour drink to kick things off 😉

This #classiccocktail is easy to make and can be simple or served with all kinds of fancy garnishes. Here’s mine!

𝙸𝙽𝙶𝚁𝙴𝙳𝙸𝙴𝙽𝚃𝚂
——————
✵ 2 oz vodka
✵ 4-5 oz orange juice
✵ Garnish - a sugar rim and fancy slice of orange, see my instructions below.

𝙸𝙽𝚂𝚃𝚁𝚄𝙲𝚃𝙸𝙾𝙽𝚂
——————
⓵ You can serve it in any kind of glass you like but I decided to serve mine in a glass chalice. To sugar your rim, dip the edge in some simple syrup to the desired depth and then sprinkle sugar all along the edge while holding the glass upside down.
⓶ Add ice to your glass, then pour in your vodka and juice and give things a gentle stir.
⓷ For your garnish - cut yourself a slice of orange, cut that in half all the way across to the other rind but don’t cut through. Remove half of the fruit so you’re left with one half still attached to the rind at the top and the other half with the rind on the bottom.

Spiral twist that long piece of rind, cut a little bit into your orange at the top so you can rest it on the rim and leave the bottom twist to dangle over the edge.

Add a straw and a little umbrella if you wanna be extra fancy and that’s it!

