.
.
Who doesn’t want a big bowl of pasta and vodka for their birthday?? 😆
I wanted to try the new @getgnooda 3 net carb pasta ASAP so I made my vodka sauce and tossed it up. 
Go check out @carbs_toketo page for a discount code. I think she just posted it in her stories 😃
.
I boiled half the bag of the @getgnooda pasta in super salty water for 7 minutes till softened. Drain and set aside.
.
Into the pot I put a tablespoon of butter and a few tablespoons of chopped onion. Once soft I added a few teaspoons of chopped garlic and stirred for a minute.
Add 1/4 a cup of vodka. Stir
Add 1/2 a cup of @raoshomemade marinara.
Add 1/4 a cup of heavy cream.
Salt
Pepper
Red pepper flake
Stir till a light blush color and add back in the pasta. Toss till the noodles are filled with the sauce.
.
I topped mine with half a hunk of burrata, olive oil, salt and pepper. Then sprinkled on some basil microgreens 😋 
I highly recommend this pasta. It’s such an amazing pasta replacement! 
.
